    function RenderShell(navBarData) {
        $("#O365_NavBarContainer").innerHTML = "";
        $("#O365_FooterContainer").innerHTML = "";
        O365Shell.SetData(navBarData);
        O365Shell.Render({ top: "O365_NavBarContainer", bottom: "O365_FooterContainer" }, function () {
            // the callback that will be executed when common shell is loaded
            $(".Page-Metro a.Button span").addClass("o365-p-c o365-p-bg o365-t-c o365-p-b");

            $(".Page-Metro a").addClass("o365-d2-ch");
            
        });
    }
    
    function HandleO365ThemeButtonHover() {
        // If button span has the theme class at first time rendering, it means current page is using Gemini Shell theme
        if ($(".Page-Metro a.Button span").hasClass("o365-p-c")) {
            $(".Page-Metro a.Button span").mouseover(function () {
                $(".Page-Metro a.Button span").addClass("o365-d2-ch o365-d2-bgh o365-t-ch o365-d2-bh");
            });
            $(".Page-Metro a.Button span").mouseout(function () {
                // Do nothing as we  already set up the color
            });
        }
    }
    

    var sessionExpiryRemainingTime = "0";
    var timerElementId = "SessionExpiryTimer";
    var timerText = "Your session will expire in {0}";
    var timerCallbackFunctionName = "";
    var timerInterval = null;

    function SetupSessionExpiryTimer()
    {
        // Add the element to the Shell
        var timerMarkup = "<div id='" + timerElementId + "'></div>";
        $("#O365_Footer").css("float", "left");
        $("#O365_Footer_Internal").append(timerMarkup);
        $("#" + timerElementId).css("cssText", "color:#DD1818; background-color: #ffffff !important;");

        // Start the timer
        timerInterval  = window.setInterval(UpdateSessionExpiryRemainingTime, 1000);

        

    }

    function UpdateSessionExpiryRemainingTime() {
        sessionExpiryRemainingTime--;

        var minutes = (sessionExpiryRemainingTime / 60) - ((sessionExpiryRemainingTime / 60) % 1);
        var seconds = sessionExpiryRemainingTime % 60;
        var time = formatTwoDigitTimeValue(minutes) + ":" + formatTwoDigitTimeValue(seconds);

        $("#" + timerElementId).html(timerText.replace("{0}", time));

        if(minutes == 0 && seconds == 0)
        {
            // Stop the interval
            window.clearInterval(timerInterval);

            // Call the callback function
            window[timerCallbackFunctionName]();
        }
    }

    function formatTwoDigitTimeValue(value) {
        if(value < 10) {
            return "0" + value.toString();
        }
        else {
            return value;
        }
    }
