                                <div id="mainDivChangePassword">
                                    <span id="ChangePasswordPropertySheet" boxtype="PropertySheet" class="PropertySheet"><input type="hidden" id="ChangePasswordPropertySheet_Collapsed" name="ChangePasswordPropertySheet" value="0"><div id="ChangePasswordPropertySheet_Body">
											<div class="ContentContainer">
