														<td id="ChangePasswordPropertySheetItem" class="Content">
                                                    
<script type="text/javascript">

    var ChangePassword = new Object();

    //TODO: Never check in, just for devfabric
    ChangePassword.RSAPublicKeyUrl = 'https://login.microsoftonline.com/ppsecure/JSPublicKey.srf';
    ChangePassword.RSAJscriptUrl = 'https://login.microsoftonline.com/ppsecure/js/PPRSAEnc.js';
    //ChangePassword.RSAPublicKeyUrl = "https://login.microsoftonline.com/ppsecure/JSPublicKey.srf?ct=1400542460&rver=6.1.6206.0&lc=1033&id=500634";
    //ChangePassword.RSAJscriptUrl = "https://login.microsoftonline.com/ppsecure/js/PPRSAEnc.js?ct=1400542460&rver=6.1.6206.0&lc=1033&id=500634";

    ChangePassword.ClientEncryptionPublicKey = '';
    ChangePassword.EmailLabel = 'ChangePasswordControl_EmailLabel';

    ChangePassword.OldPasswordTextBoxName = 'ChangePasswordControl_OldPasswordTextBox';
    ChangePassword.NewPasswordTextBoxName = 'ChangePasswordControl_NewPasswordTextBox';
    ChangePassword.ConfirmNewPasswordTextBoxName = 'ChangePasswordControl_ConfirmNewPasswordTextBox';
    ChangePassword.OldPasswordRequiredValidatorName = 'ChangePasswordControl_OldPasswordRequiredValidator';

    ChangePassword.NewPasswordMinimumLengthValidatorName = 'ChangePasswordControl_NewPasswordMinimumLengthValidator';
    ChangePassword.NewPasswordMaximumLengthValidatorName = 'ChangePasswordControl_NewPasswordMaximumLengthValidator';
    ChangePassword.NewPasswordCharacterExpressionValidatorName = 'ChangePasswordControl_NewPasswordCharacterExpressionValidator';
    ChangePassword.NewPasswordRequiredValidatorName = 'ChangePasswordControl_NewPasswordRequiredValidator';

    ChangePassword.ConfirmNewPasswordMinimumLengthValidatorName = 'ChangePasswordControl_ConfirmNewPasswordMinimumLengthValidator';
    ChangePassword.ConfirmNewPasswordMaximumLengthValidatorName = 'ChangePasswordControl_ConfirmNewPasswordMaximumLengthValidator';
    ChangePassword.ConfirmNewPasswordCharacterExpressionValidatorName = 'ChangePasswordControl_ConfirmNewPasswordCharacterExpressionValidator';
    ChangePassword.ConfirmNewPasswordRequiredValidatorName = 'ChangePasswordControl_ConfirmNewPasswordRequiredValidator';    
    
    ChangePassword.PasswordMatchValidatorName = 'ChangePasswordControl_PasswordMatchValidator';
    ChangePassword.CheckPasswordStrengthValidatorName = 'ChangePasswordControl_PasswordStrengthValidator';
    ChangePassword.OldAndNewPasswordsAreDifferentCustomValidatorName = 'ChangePasswordControl_OldAndNewPasswordsAreDifferentCustomValidator';

    ChangePassword.OldPasswordCipherTextName = 'ChangePasswordControl_OldPasswordCipherTextField';
    ChangePassword.CredentialsCipherTextName = 'ChangePasswordControl_CredentialsCipherTextField';
    ChangePassword.HexBinarySkiFieldName = 'ChangePasswordControl_HexBinarySkiField';
    ChangePassword.EncryptionVersionFieldName = 'ChangePasswordControl_EncryptionVersionField';

    ChangePassword.EncryptedOldPasswordTextName = 'ChangePasswordControl_EncryptedOldPasswordTextField';
    ChangePassword.EncryptedNewPasswordTextName = 'ChangePasswordControl_EncryptedNewPasswordTextField';

    ChangePassword.EncodedOldPasswordTextName = 'ChangePasswordControl_EncodedOldPasswordTextField';
    ChangePassword.EncodedNewPasswordTextName = 'ChangePasswordControl_EncodedNewPasswordTextField';

    ChangePassword.IsClientEncryptionRequired = 'False';

    ChangePassword.SubmitButton = 'ChangePasswordControl_OkButton';
    ChangePassword.CancelButton = 'ChangePasswordControl_CancelButton';

    ChangePassword.CheckPasswordMatch = function(source, arguments) {
        arguments.IsValid = this.ValidatePasswords();
    }

    ChangePassword.CheckPasswordStrength = function (source, arguments) {
        arguments.IsValid = true;

        if (ChangePassword.BeforePasswordStrength()) {
            arguments.IsValid = PasswordStrengthMeter.ClientSideStrongPassword(arguments.Value);
        }
    }

    ChangePassword.BeforePasswordStrength = function () {
        // first check if password legth is valid; // check that  only visible chars are present
        var resultIsValid = true;
        var minLength_val = document.getElementById(this.NewPasswordMinimumLengthValidatorName);
        ValidatorValidate(minLength_val);
        resultIsValid = minLength_val.isvalid && resultIsValid;
        if (resultIsValid) {
            var maxLength_val = document.getElementById(this.NewPasswordMaximumLengthValidatorName);
            ValidatorValidate(maxLength_val);
            resultIsValid = maxLength_val.isvalid && resultIsValid;
            if (resultIsValid) {
                // check that  only visible chars are present
                var char_val = document.getElementById(ChangePassword.NewPasswordCharacterExpressionValidatorName);
                ValidatorValidate(char_val);
                resultIsValid = char_val.isvalid && resultIsValid;
            }
        }

        return resultIsValid;

    }

    ChangePassword.CheckNewPasswordIsDifferentFromOld = function(source, arguments) {
        arguments.IsValid = this.ValidateNewAndOldPasswordsAreDifferent();
    }

    ChangePassword.AggregateValidator = function (source, arguments) {
        arguments.IsValid = true;

        var validatorMessages = $("." + source.className);
        $(validatorMessages).css("display", "none");

        for (var i = 0; i < validatorMessages.length; i++) {
            if ($(validatorMessages[i]).css("visibility") == "visible") {
                $(validatorMessages[i]).css("display", "block");
                break;
            }
        }
    }

    /// <summary>
    // This method is intended to set UI properties after the page post back.
    /// </summary>
    ChangePassword.CustomServerValidator = function (source, arguments) {
        arguments.IsValid = true;
        $("#" + source.id).css("display", "none");
    }

    ChangePassword.ValidateNewAndOldPasswordsAreDifferent = function() {
        if (document.getElementById(this.OldPasswordTextBoxName).value == document.getElementById(this.NewPasswordTextBoxName).value) {
            return false;
        }

        return true;
    }

    ChangePassword.ValidatePasswords = function() {
        if (document.getElementById(this.NewPasswordTextBoxName).value == '') {
            return false;
        }

        if (document.getElementById(this.NewPasswordTextBoxName).value != document.getElementById(this.ConfirmNewPasswordTextBoxName).value) {
            return false;
        }
        return true;
    }

    ChangePassword.ValidateAndEncryptCredentials = function () {

        this.EvaluateValidators();

        if (typeof (ValidatorOnSubmit) == "function" && ValidatorOnSubmit() == false) {
            this.ReportClientSideError("The ValidatorOnSubmit() method result is false.");
            return;
        }

        if (Page_IsValid == false) {
            return false;
        }

        var locals = new Array();

        try
        {
            // Set the local Functions and Variables 
            // for logging purposes.

            // Functions
            locals.push("Is parseRSAKeyFromString is defined: " + (typeof (parseRSAKeyFromString) == "function"))
            locals.push("Is RSAencrypt is defined: " + (typeof (RSAencrypt) == "function"))

            // Variables
            locals.push("SKI value: " + SKI);
            locals.push("EncryptionVersion value: " + EncryptionVersion);

            // Input Fields
            var oldPassword = document.getElementById(this.OldPasswordTextBoxName);
            var newPassword = document.getElementById(this.NewPasswordTextBoxName);
            var confirmNewPassword = document.getElementById(this.ConfirmNewPasswordTextBoxName);


            if (ChangePassword.IsClientEncryptionRequired == 'True') {
                // Encryption Values
                var OldPasswordCipherTextValue = EncryptOldPassword(oldPassword.value);
                locals.push("OldPasswordCipherText value: " + OldPasswordCipherTextValue);

                var CredentialsCipherTextValue = EncryptedProperties(newPassword.value, "", oldPassword.value, "");
                locals.push("CredentialsCipherText value: " + CredentialsCipherTextValue);

                if (ChangePassword.ClientEncryptionPublicKey != '') {
                    document.getElementById(this.EncryptedOldPasswordTextName).value = EncryptString(ChangePassword.ClientEncryptionPublicKey, oldPassword.value);
                    document.getElementById(this.EncryptedNewPasswordTextName).value = EncryptString(ChangePassword.ClientEncryptionPublicKey, newPassword.value);
                }

                locals.push("EncryptedOldPasswordText value: " + document.getElementById(this.EncryptedOldPasswordTextName).value);
                locals.push("EncryptedNewPasswordText value: " + document.getElementById(this.EncryptedNewPasswordTextName).value);

                // Set the encrypted password to the hidden fields
                // to be sent in the POST request.
                document.getElementById(this.OldPasswordCipherTextName).value = OldPasswordCipherTextValue;
                document.getElementById(this.CredentialsCipherTextName).value = CredentialsCipherTextValue;
                document.getElementById(this.HexBinarySkiFieldName).value = SKI;
                document.getElementById(this.EncryptionVersionFieldName).value = EncryptionVersion;
            }
           
            // Disable the form. This ensures that the passwords are not sent to the server side.
            $("#" + this.ConfirmNewPasswordTextBoxName).prop("disabled", true);
            $("#" + this.NewPasswordTextBoxName).prop("disabled", true);
            $("#" + this.OldPasswordTextBoxName).prop("disabled", true);

            $("#" + this.EncodedNewPasswordTextName).val(encodeURIComponent(newPassword.value));
            $("#" + this.EncodedOldPasswordTextName).val(encodeURIComponent(oldPassword.value));

            // Change the opacity of the Submit button since the BOX button implementation does not change it by default.
            $("#okButtonContainer").addClass("DisabledInput");
            Button.Disable(this.SubmitButton);
            Button.Disable(this.CancelButton);

            // Show the spinner
            $("#loadingAnimationImage").show();

        }
        catch (error) {
            this.ReportClientSideError("There has been an error in the ValidateAndEncryptCredentials() method. " +
                "Message: " + error.message + ". " +
                "Stack: " + error.stack + ". " +
                "Locals: " + locals.toString() + ". " +
                "RSAJscriptUrl: " + ChangePassword.RSAJscriptUrl + ". " +
                "RSAPublicKeyUrl: " + ChangePassword.RSAPublicKeyUrl + ".");
        }
    }

    ChangePassword.ReportClientSideError = function (messageText) {
        var urlLocation = "ChangePassword.aspx/ReportClientSideError";
        var upnValue = document.getElementById(ChangePassword.EmailLabel).innerHTML;

        if (window.location.pathname.toLowerCase().indexOf('logincredprof') != -1)
        {
            urlLocation = "../" + urlLocation;
        }

        $.ajax({
            type: "POST",
            url: urlLocation,
            data: JSON.stringify({ upn: upnValue, message: messageText }),
            contentType: "application/json",
            dataType: "json",
            error: function () {
                // Ignore any errors due to the web method's failure to log
            }
        });
    }

    //<summary>
    // Evaluates the validators by calling the ASP.NET client library method ValidatorValidate, which check if the specified
    // validator is enabled and then proceed to evaluate it. Then refresh the value of the global variable Page_IsValid
    // accordingly.
    //</summary>
    ChangePassword.EvaluateValidators = function () {

        try {

            // The validator will only be evaluated if it is enabled, otherwise it will be ignored.

            ValidatorValidate(document.getElementById(this.OldPasswordRequiredValidatorName));
            ValidatorValidate(document.getElementById(this.NewPasswordRequiredValidatorName));
            ValidatorValidate(document.getElementById(this.NewPasswordMinimumLengthValidatorName));
            ValidatorValidate(document.getElementById(this.NewPasswordMaximumLengthValidatorName));
            ValidatorValidate(document.getElementById(this.NewPasswordCharacterExpressionValidatorName));
            ValidatorValidate(document.getElementById(this.CheckPasswordStrengthValidatorName));
            ValidatorValidate(document.getElementById(this.ConfirmNewPasswordRequiredValidatorName));
            ValidatorValidate(document.getElementById(this.ConfirmNewPasswordMinimumLengthValidatorName));
            ValidatorValidate(document.getElementById(this.ConfirmNewPasswordMaximumLengthValidatorName));
            ValidatorValidate(document.getElementById(this.ConfirmNewPasswordCharacterExpressionValidatorName));
            ValidatorValidate(document.getElementById(this.PasswordMatchValidatorName));

            ValidatorUpdateIsValid();

        }
        catch (error) {

            this.ReportClientSideError("There has been an error evaluating the validators." +
               "Stack: " + error.stack + ". " +
               "RSAJscriptUrl: " + ChangePassword.RSAJscriptUrl + ". " +
               "RSAPublicKeyUrl: " + ChangePassword.RSAPublicKeyUrl + ".");
        }
    }

    ChangePassword.LoadScript = function(src) { 
       var script = document.createElement("script"); 
       script.type = "text/javascript"; 
       document.getElementsByTagName("head")[0].appendChild(script); 
       script.src = src; 
    }

    // We use the two variables "SKI" and "parseRSAKeyFromString" as beacons to determine if the scripts have loaded.
    // If they have not been loaded, we attempt to reload them.
    ChangePassword.EnsureEncryptionJavascriptHasLoaded = function () {
        if (typeof SKI === 'undefined' || typeof parseRSAKeyFromString === 'undefined') {
            if (typeof SKI === 'undefined') {
                ChangePassword.LoadScript(ChangePassword.RSAPublicKeyUrl);
            }

            if (typeof parseRSAKeyFromString === 'undefined') {
                ChangePassword.LoadScript(ChangePassword.RSAJscriptUrl);
            }

            setTimeout(ChangePassword.EnsureEncryptionJavascriptHasLoaded, 1000);
        }
    }

</script>
